import SignIn from "./components/SignIn"
import SignUp from "./components/SignUp"
import { BrowserRouter,Routes, Route } from "react-router-dom"
const App=()=>{
    return(
        <div>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={SignIn} />
                    <Route path="/signup" element={SignUp} />
                </Routes>
            </BrowserRouter>
        </div>
    )
}
export default App;
